import React, {useState} from 'react'
import Display from '../component/Display';

function Dashboard() {
    const [result, setResult] = useState({})

    const handleClick = async () => {
        console.log('Clicked Bookings');
        const response = await fetch(`https://playo.club/book-api/v5/availability/e63abe94-2547-409a-9b30-82cbcec2c468/SP4/2022-04-06/?userId=7406560606&deviceType=99`,
            {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                    'Authorization': 'b4ee93df154de37b0e38aa6a5dfda071aa751bfa'    
                }
            });
        const res = await response.json();
        console.log(res);
        setResult(res);
    }

  return (
    <div>
        <Display res={result}/>
        <button onClick={handleClick}>Check Bookings</button>
    </div>
  )
}

export default Dashboard;
